import Foundation

public class Puzzle_2018_05: NSObject {
    private enum Polarity {
        case upper
        case lower
    }

    private struct Unit {
        var polarity: Polarity
        var value: String

        init(string: String) {
            self.polarity = string == string.lowercased() ? .lower : .upper
            self.value = string.lowercased()
        }

        func sameButNotPolarity(with unit: Unit) -> Bool {
            self.value == unit.value && self.polarity != unit.polarity
        }
    }

    private func fullySmash(_ startUnits: [Unit]) -> [Unit] {
        var startUnits = startUnits
        var endUnits = self.smash(startUnits)
        while startUnits.count != endUnits.count {
            startUnits = endUnits
            endUnits = self.smash(startUnits)
        }

        return endUnits
    }

    private func smash(_ units: [Unit]) -> [Unit] {
        var endUnits = [Unit]()
        var skipUnit = false
        for (index, unit) in units.enumerated() {
            if skipUnit {
                skipUnit = false
            } else {
                let nextIndex = index + 1
                if nextIndex < units.count {
                    let nextUnit = units[nextIndex]
                    if unit.sameButNotPolarity(with: nextUnit) {
                        skipUnit = true
                    } else {
                        endUnits.append(unit)
                    }
                } else {
                    endUnits.append(unit)
                }
            }
        }
        return endUnits
    }

    public func solve() {
        let part1 = solvePart1()
        print("Part 1 solution: \(part1)")
        let part2 = solvePart2()
        print("Part 2 solution: \(part2)")
    }

    public func solvePart1() -> Int {
        let puzzleInput = Puzzle_2018_05_Input.puzzleInput
        return solvePart1(polymer: puzzleInput)
    }

    public func solvePart2() -> Int {
        let puzzleInput = Puzzle_2018_05_Input.puzzleInput
        return solvePart2(polymer: puzzleInput)
    }

    private func decomposePolymer(polymer: String) -> String {
        var str = polymer
        var removalFound: Bool
        var furthestAdvance = 0
        repeat {
            removalFound = false
            if furthestAdvance < (str.count - 1) {
                for i in furthestAdvance..<(str.count - 1) {
                    let c1 = String(str[i])
                    let c2 = String(str[i + 1])
                    if c1.uppercased() == c2.uppercased() && c1 != c2 {
                        removalFound = true
                        str.removeAtIndex(idx: i + 1)
                        str.removeAtIndex(idx: i)
                        furthestAdvance = i - 1
                        if furthestAdvance < 0 {
                            furthestAdvance = 0
                        }

                        break
                    }
                }
            }
        } while removalFound

        return str
    }

    private func decomposePolymerFaster(polymer: String) -> String {
        // this method is much faster but uses up more memory
        var str = polymer
        var lengthBeforeIteration: Int
        repeat {
            lengthBeforeIteration = str.count
            for c in "abcdefghijklmnopqrstuvwxyz" {
                let c1 = String(c) + String(c).uppercased()
                let c2 = String(c).uppercased() + String(c)
                str = str.replacingOccurrences(of: c1, with: "").replacingOccurrences(of: c2, with: "")
            }
        } while str.count != lengthBeforeIteration

        return str
    }

    private func solvePart1(polymer: String) -> Int {
        decomposePolymerFaster(polymer: polymer).count
    }

    private func solvePart2(polymer: String) -> Int {
        // This was my feeble attempt to process with strings, it took about 100 seconds to finish because of all the string thrashing
//        var retval = Int.max
//        for c in "abcdefghijklmnopqrstuvwxyz" {
//            let c1 = String(c)
//            let c2 = String(c).uppercased()
//            let newPolymer = polymer.replacingOccurrences(of: c1, with: "").replacingOccurrences(of: c2, with: "")
//            let newerPolymer = decomposePolymerFaster(polymer: newPolymer)
//            if newerPolymer.count < retval {
//                retval = newerPolymer.count
//            }
//        }
//
//        return retval

        let startUnits = polymer.map { Unit(string: "\($0)") }
        // Pre smash the input to optimize since we are always going to be doing that work
        let preSmashedUnits = fullySmash(startUnits)
        var smallestCount = Int.max
        for char in "abcdefghijklmnopqrstuvwxyz" {
            let tempUnits = preSmashedUnits.filter { $0.value != "\(char)" }
            let smashedCount = fullySmash(tempUnits).count
            if smashedCount < smallestCount {
                smallestCount = smashedCount
            }
        }

        return smallestCount
    }
}

